ansi_cores = {
    "0": "30", "1": "34", "2": "32", "3": "36", "4": "31", "5": "35",
    "6": "33", "7": "37", "8": "90", "9": "94", "A": "92", "B": "96",
    "C": "91", "D": "95", "E": "93", "F": "97"
}



def aplicar_cor_console(codigo):
    if len(codigo) != 2:
        return  # Evita erro se cdigo for invlido

    texto, fundo = codigo[0].upper(), codigo[1].upper()

    if os.name == "nt":
        # Windows usa comando interno do terminal
        os.system(f"color {codigo}")
    else:
        # ANSI no Linux/macOS
        ansi_texto = ansi_cores.get(texto, "37")  # padro: branco
        ansi_fundo = ansi_cores.get(fundo, "40").replace("3", "4", 1)  # converte fg 3x  bg 4x
        print(f"\033[{ansi_texto};{ansi_fundo}m", end="")

# Funo para salvar a cor escolhida no arquivo de configurao
def salvar_cor(codigo_cor):
    with open(CONFIG_FILE, "w") as f:
        json.dump({"cor": codigo_cor}, f)

# Funo para carregar a cor salva do arquivo de configurao
def carregar_cor():
    if os.path.exists(CONFIG_FILE):
        with open(CONFIG_FILE, "r") as f:
            return json.load(f).get("cor", "0A")  # Retorna o cdigo da cor ou "0A" por padro
    return "0A"  # Retorna o valor padro caso o arquivo no exista

class TelaCores(QWidget):
    def __init__(self):
        super().__init__()
        self.setWindowTitle("Escolher Cor do Console")
        self.setGeometry(300, 300, 400, 200)
        
        # Defina o cone da janela (se necessrio)
        pixmap = QPixmap()

        pixmap.loadFromData(QByteArray.fromBase64(icone_base64))
