class TelaSimples(QDialog):
    def __init__(self, parent=None):
        super().__init__(parent)
        self.setWindowTitle("Modo Simples - Escolher Cor")
        self.setGeometry(350, 350, 300, 200)

        # Defina o cone da janela (se necessrio)
        pixmap = QPixmap()
        pixmap.loadFromData(QByteArray.fromBase64(icone_base64))  # Certifique-se de ter o icone_base64
        self.setWindowIcon(QIcon(pixmap))

        layout = QVBoxLayout()

        label = QLabel("Selecione a cor do console:")
        label.setFont(QFont("Arial", 12))
        layout.addWidget(label)

        self.combo = QComboBox()

        # Dicionrio de cores e seus cdigos
        self.opcoes_cores = {
            "Preto": "0", "Cinza": "8", "Azul": "1", "Azul Claro": "9",
            "Verde": "2", "Verde Claro": "A", "Verde-gua": "3", "Verde-gua Claro": "B",
            "Vermelho": "4", "Vermelho Claro": "C", "Roxo": "5", "Lils": "D",
            "Amarelo": "6", "Amarelo Claro": "E", "Branco": "7", "Branco Brilhante": "F"
        }

        # Gerando todas as combinaes de cores de fundo e texto onde os cdigos so diferentes
        for fundo_nome, fundo_codigo in self.opcoes_cores.items():
            for texto_nome, texto_codigo in self.opcoes_cores.items():
                # Garantir que o cdigo do fundo e do texto no sejam iguais
                if fundo_codigo != texto_codigo:
                    chave = f"{texto_nome} em {fundo_nome}"  # Nome da combinao
                    combinacao = f"{texto_codigo}{fundo_codigo}"  # Cdigo da combinao
                    descricao = f"{chave} ({combinacao})"
                    self.combo.addItem(descricao)

        layout.addWidget(self.combo)

        # Boto para salvar e fechar
        btn_salvar = QPushButton("Salvar e Fechar")
        btn_salvar.clicked.connect(self.salvar_selecao)
        layout.addWidget(btn_salvar)

        self.setLayout(layout)
    def salvar_selecao(self):
            # Obtm a combinao selecionada
            selecionado = self.combo.currentText()
            texto_fundo = selecionado.split('(')[1].split(')')[0]  # Extraindo o cdigo de cor
            cor = texto_fundo.strip()  # Obter o cdigo da cor
            
            # Chama a funo para salvar a cor
            salvar_cor(cor)  # Defina ou implemente a funo salvar_cor conforme sua necessidade
            
            # Fecha o dilogo
            self.accept()  # Fecha o dilogo
            
            # Fecha a janela principal
            if self.parent():
                self.parent().close()  # Fecha a janela principal (se houver)

